import React from 'react'
import ReactDOM from 'react-dom'
import "./style.css"

function Appy(){
    return (
        <div>
        <h1 style={{textAlign: "center"}}>hellworld</h1>
        <button class="button">hey</button>
        </div>
    );
    
   
}


ReactDOM.render(<Appy />, document.getElementById('root'));
